BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "AssetBases" (
	"AssetBaseId"	INTEGER NOT NULL,
	"id"	TEXT,
	"logicid"	TEXT,
	"ip"	TEXT,
	"GroupName"	TEXT,
	"ZoneName"	TEXT,
	"SpeakerName"	TEXT,
	"path"	TEXT,
	"floor"	TEXT,
	"DeviceName"	TEXT,
	"state"	TEXT,
	"state_old"	TEXT,
	"chk"	INTEGER NOT NULL DEFAULT 0,
	"seq"	INTEGER NOT NULL,
	"AssetGroupId"	INTEGER NOT NULL,
	CONSTRAINT "FK_AssetBases_AssetGroups_AssetGroupId" FOREIGN KEY("AssetGroupId") REFERENCES "AssetGroups"("AssetGroupId") ON DELETE CASCADE,
	CONSTRAINT "PK_AssetBases" PRIMARY KEY("AssetBaseId" AUTOINCREMENT)
);
CREATE INDEX IF NOT EXISTS "IX_AssetBases_AssetGroupId" ON "AssetBases" (
	"AssetGroupId"
);
COMMIT;
